import React, { useEffect } from "react";
import { Fragment } from "react";
import { getTests } from "../actions/productActions";
import { useDispatch, useSelector } from "react-redux";
import { useLocation, useNavigate } from "react-router-dom";

const Test = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const selectedTest = location.state?.selectedTest || "CDS";
  console.log("üîç Selected Test Category:", selectedTest);

  if (!selectedTest) {
    console.error("‚ö†Ô∏è No category found. Redirecting...");
    navigate("/");
    return null;
  }

  const dispatch = useDispatch();
  const { loading, tests, error } = useSelector((state) => state.tests);
  console.log("Redux State:", { loading, tests, error });

  useEffect(() => {
    if (selectedTest && selectedTest !== "Unknown") {
      console.log("üü¢ Dispatching getTests with category:", selectedTest);
      dispatch(getTests(selectedTest));
      window.scrollTo(0, 0);
    } else {
      console.warn("‚ö†Ô∏è No valid category found. Skipping dispatch.");
    }
  }, [dispatch, selectedTest]);

  return (
    <Fragment>
      <div className="test-body">
        <div className="test-head">
          <div className="test-name">
            <p>{selectedTest} Full Test</p>
          </div>
          <div className="timeleft">
            <p>Time left 00:00:00</p>
          </div>
          <div className="full-button">
            <button>Enter Full Screen</button>
          </div>
        </div>
        <div className="test-content">
          <div className="test-section">
            <div className="ques">
              <p>Question No. 1</p>
            </div>
            <div className="section-marks">
              <div className="correct">
                <p>Correct</p>
                <p>+4</p>
              </div>
              <div className="incorrect">
                <p>Incorrect</p>
                <p>-1</p>
              </div>
            </div>
          </div>
          <div className="test-question">
            <div className="question">
              <p>What is my name?</p>
            </div>
            <div className="test-options">
              <div>
                <label>
                  <input type="radio" name="option" value="A" />
                  <span>Option A</span>
                </label>
              </div>
              <div>
                <label>
                  <input type="radio" name="option" value="B" />
                  <span>Option B</span>
                </label>
              </div>
              <div>
                <label>
                  <input type="radio" name="option" value="C" />
                  <span>Option C</span>
                </label>
              </div>
              <div>
                <label>
                  <input type="radio" name="option" value="D" />
                  <span>Option D</span>
                </label>
              </div>
            </div>
          </div>
        </div>
        <div className="test-submit">
          <div className="test-save">
            <button>Previous Question</button>
            <button>Save & Next</button>
          </div>
          <div className="test-save">
            <button className="submit-btn">Submit</button>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default Test;
